var defaultPixel = 0;

var current = input;
var lit = 0;

for (var i = 0; i < 50; i++)
{
    lit = 0;
    var next = new int[current.GetLength(0) + 2, current.GetLength(1) + 2];

    for (var x = 0; x < next.GetLength(0); x++)
    {
        for (var y = 0; y < next.GetLength(1); y++)
        {
            var index = FromBinary(
                GetNext(x - 1, y - 1), GetNext(x -1, y), GetNext(x - 1, y + 1),
                GetNext(x, y -1 ), GetNext(x, y), GetNext(x, y + 1),
                GetNext(x + 1, y - 1), GetNext(x + 1, y), GetNext(x + 1, y + 1)
                );
            next[x,y] = algorithm[index] == '#' ? 1 : 0;

            if (next[x, y] == 1)
                lit++;
        }
    }
    //Update default pixel
    defaultPixel = algorithm[FromBinary(defaultPixel,defaultPixel, defaultPixel, defaultPixel, defaultPixel, defaultPixel, defaultPixel, defaultPixel, defaultPixel)] == '#' ? 1 : 0;
    current = next;
}



// See https://aka.ms/new-console-template for more information
Console.WriteLine($"{lit} pixels lit.");
Console.ReadLine();


int FromBinary(int one, int two, int three, int four, int five, int six, int seven, int eight, int nine)
{
    var result = (int)(Math.Pow(2, 8) * one + Math.Pow(2, 7) * two + Math.Pow(2, 6) * three + Math.Pow(2, 5) * four + Math.Pow(2, 4) * five + Math.Pow(2, 3) * six + Math.Pow(2, 2) * seven + Math.Pow(2, 1) * eight + Math.Pow(2, 0) * nine);

    return result;
}

int GetNext(int x, int y)
{
    //Adjustment for the input being two larger
    x -= 1;
    y -= 1;

    if (x > -1 && y > -1 && current.GetLength(0) > x && current.GetLength(1) > y)
        return current[x, y];
    else
        return defaultPixel;
}